export default function getOverallTotal(props, ret=['device', 'user', 'did']) {
  let overallTotal = 0

  if (props.data['display']['nonehighlighted']) {
    ret.forEach((e) => {
      if (props.data['display'][e]['total'] > overallTotal) overallTotal = props.data['display'][e]['total']
    })
    
    return overallTotal
  }

  else {
    ret.forEach((e) => {
      if (props.data['display'][e]['highlighted']) /* pass */ 
      if (props.data['display'][e]['total'] > overallTotal) overallTotal = props.data['display'][e]['total']
    })

    return overallTotal
  }
}
